    if (showIcons) {
      const {
        icon,
        color
      } = resolveIconAndColor(checked);
      optionIcon = <EuiIcon className="euiSelectableListItem__icon" color={color} type={icon} />;
    }

    let state;
    let instruction;

    if (allowExclusions && checked === 'on') {
      state = <EuiScreenReaderOnly>
          <span>
            <EuiI18n token="euiSelectableListItem.includedOption" default="Included option." />
          </span>
        </EuiScreenReaderOnly>;
      instruction = <EuiScreenReaderOnly>
          <span>
            <EuiI18n token="euiSelectableListItem.includedOptionInstructions" default="To exclude this option, press enter." />
          </span>
        </EuiScreenReaderOnly>;
    } else if (allowExclusions && checked === 'off') {
      state = <EuiScreenReaderOnly>
          <span>
            <EuiI18n token="euiSelectableListItem.excludedOption" default="Excluded option." />
          </span>
        </EuiScreenReaderOnly>;
      instruction = <EuiScreenReaderOnly>
          <span>
            <EuiI18n token="euiSelectableListItem.excludedOptionInstructions" default="To deselect this option, press enter." />
          </span>
        </EuiScreenReaderOnly>;
    }

    let prependNode;

    if (prepend) {
      prependNode = <span className="euiSelectableListItem__prepend">{prepend}</span>;
    }

    let appendNode;

    if (append || !!onFocusBadge) {
      let onFocusBadgeNode;
      const defaultOnFocusBadgeProps = {
        'aria-hidden': true,
        iconType: 'returnKey',
        iconSide: 'left',
        color: 'hollow'
      };

      if (onFocusBadge === true) {
        onFocusBadgeNode = <EuiBadge className="euiSelectableListItem__onFocusBadge" {...defaultOnFocusBadgeProps} />;
      } else if (!!onFocusBadge && onFocusBadge !== false) {
        const {
          children,
          className,
          ...restBadgeProps
        } = onFocusBadge;
        onFocusBadgeNode = <EuiBadge className={classNames('euiSelectableListItem__onFocusBadge', className)} {...defaultOnFocusBadgeProps} {...restBadgeProps}>
            {children}
          </EuiBadge>;
      } // Only display the append wrapper if append exists or isFocused


      if (append || isFocused && !disabled) {
        appendNode = <span className="euiSelectableListItem__append">
            {append} {isFocused && !disabled ? onFocusBadgeNode : null}
          </span>;
      }
    }

    return <li // eslint-disable-next-line jsx-a11y/no-noninteractive-element-to-interactive-role
    role="option" aria-selected={!disabled && typeof checked === 'string'} className={classes} aria-disabled={disabled} {...rest}>
        <span className="euiSelectableListItem__content">
          {optionIcon}
          {prependNode}
          <span className="euiSelectableListItem__text">
            {state}
            {children}
            {instruction}
          </span>
          {appendNode}
        </span>
      </li>;
  }

}
